function FactRow({ fact, index }: { fact: fact; index: number }) {
  const [isHovered, setIsHovered] = useState(false);
  
  // Alternate rotation: even indices rotate right (+), odd rotate left (-)
  const rotation = index % 2 === 0 ? 12 : -12;

    function pickOneToThree(): 1 | 2 | 3 {
    const values = [1, 2, 3] as const
    return values[Math.floor(Math.random() * values.length)]
  }
  
  return (
    <motion.div
      className="relative"
      onHoverStart={() => setIsHovered(true)}
      onHoverEnd={() => setIsHovered(false)}
    >
      <div className="grid grid-cols-2 gap-8 py-6 border-b border-gray-400/30 cursor-pointer">
        <div className="text-lg">{fact.label}</div>
        <div className="text-lg text-right">{fact.value}</div>
      </div>
      
      {/* Hover Card */}
      <motion.div
        className="absolute left-1/2 -translate-x-1/2 pointer-events-none z-20"
        initial={{ opacity: 0, y: 20, rotate: 0 }}
        animate={isHovered ? {
          opacity: 1,
          y: -80,
          rotate: rotation
        } : {
          opacity: 0,
          y: 20,
          rotate: 0
        }}
        transition={{
          duration: 0.4,
          ease: [0.32, 0.72, 0, 1]
        }}
      >
        {fact.hoverContent === "notion" ? (
          <div className="bg-[var(--color-warm-accent)] rounded-2xl border-4 border-white w-36 h-36 flex items-center justify-center">
            {pickOneToThree() === 1 ? (
              <VscVscode className="w-24 h-24" />
            ) : pickOneToThree() === 2 ? (
              <VscVscodeInsiders className="w-24 h-24" />
            ) : (
              <FiGithub className="w-24 h-24" />
            )}
          </div>
        ) : (
          <div className="bg-white rounded-2xl shadow-lg border-4 border-white w-36 h-36 flex items-center justify-center overflow-hidden">
            {/* Replace with actual images - using emoji placeholders */}
            <img src={fact.image} alt={fact.value} className="w-full h-full object-cover" />
          </div>
        )}
      </motion.div>
    </motion.div>
  );
}